(7, , 'Mercedes-Benz Actros 1845', 'Engine Type: Mercedes-Benz OM 471, 12.8L 6-cylinder in-line Turbocharged Diesel\r\n\r\n', 'Displacement: 12.8 liters\r\n', 'Power Output: Approximately 450 horsepower\r\n', 'Torque: Approximately 2,200 Nm', '', '', 'Transmission Types: PowerShift 3 automated transmission with 12 gears', 'Frame Type: Designed for heavy-duty applications with a high-strength steel frame.\r\n', 'Suspension: Air suspension for enhanced comfort and load stability.\r\n', 'The Actros 1845 is designed for heavy-duty transport applications with a high payload capacity.', 'The Actros offers various cabin configurations, including StreamSpace and BigSpace for sleeping amenities during long-distance hauling.', 'Advanced safety features, including Mercedes-Benz\'s safety systems like Active Brake Assist and Lane-Keeping Assist.\r\n', 'Multimedia system with connectivity options.\r\n', 'Comfort features such as air conditioning, power steering, and adjustable seats.\r\n', '', '', 'Overall Length: Varies by body configuration and regional regulations.\r\n', 'Wheelbase: Varies by body configuration.\r\n', 'Gross Vehicle Weight Rating (GVWR): Reflects its heavy-duty classification.\r\n', '', '', 'The Mercedes-Benz Actros 1845 is suitable for various heavy-duty transport applications, especially in long-distance freight.');

